import{WorkExperienceRepository}from"../../repository/work-experience-repository.js";import{Datetime}from"../../shared/utility/datetime.min.js";class DatabaseExperienceGraphModel{getDatabaseExperience=()=>{const e=(new WorkExperienceRepository).getAll(),t={};for(const o of e){if(!o.database||0===o.database.length)continue;if(!o.period.from||!o.period.to)continue;const e=Datetime.getNumberOfDays(o.period.from),r=Datetime.getNumberOfDays(o.period.to)-e;for(const e of o.database)t[e]||(t[e]=0),t[e]+=r}return t}}export{DatabaseExperienceGraphModel};